window.bookSummaryJSON = "<p><b>From the #1 </b><b><i>New York Times</i></b><b> bestselling author of </b><b><i>The Nightingale </i></b><b>and</b><b><i> The Great Alone</i></b><b> comes an incandescent story about the resilience of the human spirit, the triumph of hope, and the meaning of home.</b></p> <p>In the rugged Pacific Northwest lies the Olympic National Forest - nearly a million acres of impenetrable darkness and impossible beauty. From deep within this old growth forest, a six-year-old girl appears. Speechless and alone, she offers no clue as to her identity, no hint of her past.</p> <p>Having retreated to her western Washington hometown after a scandal left her career in ruins, child psychiatrist Dr. Julia Cates is determined to free the extraordinary little girl she calls Alice from a prison of unimaginable fear and isolation. To reach her, Julia must discover the truth about Alice’s past - although doing so requires help from Julia’s estranged sister, a local police officer. The shocking facts of Alice’s life test the limits of Julia’s faith and strength, even as she struggles to make a home for Alice - and for herself.</p> <p><b>“One of [Kristin Hannah’s] most compelling and riveting novels.” - </b><b><i>Booklist</i></b></p>"; 
